import {
  createBrowserRouter,
  RouterProvider,
  Route,
  Outlet,
} from "react-router-dom"
import { Home } from "./pages/Home/Home";
import { Products } from "./pages/Products/Products";
import { Product } from "./pages/Product/Product";
import { Blog } from "./pages/Blog/Blog";

const Layout = () => {
  return (
    <div className="app">
      
    </div>
  )
}

const router = createBrowserRouter([
  {
    path:"/",
    element:<Home/>
  },
  {
    path:"/products/:id",
    element:<Products/>
  },
  {
    path:"/product/:id",
    element:<Product/>
  },
  {
    path:"/blog/:id",
    element:<Blog/>
  },
])

function App() {
  return <div>
    <RouterProvider router={router}/>
  </div>;
}

export default App;
